//GET LIST
export const listWaysOfWorkingRequest = function(){
  return {
    type: "LIST_WAYS_OF_WORKING_REQUEST"
  }
}

export const listWaysOfWorkingSuccess = function(waysOfWorking) {
  return {
    type: "LIST_WAYS_OF_WORKING_SUCCESS",
    waysOfWorking
  }
}

export const listWaysOfWorkingError = function(data) {
  return {
    type: "LIST_WAYS_OF_WORKING_ERROR",
    data
  }
}
